import collections
import functools


class Solution:
    def longestIdealString(self, s: str, k: int) -> int:
        stack = []

        @functools.lru_cache(None)
        def dfs(index):
            if index == len(s):
                return len(stack)
            max_len = 0
            if not stack or abs(ord(stack[-1]) - ord(s[index])) <= k:
                stack.append(s[index])
                max_len = max(dfs(index + 1), max_len)
                stack.pop()
            max_len = max(max_len, dfs(index + 1))

            return max_len

        return dfs(0)

    def longestIdealString(self, s: str, k: int) -> int:
        @functools.lru_cache(None)
        def recurssion(i, prev):
            if i == len(s):
                return 0

            output = recurssion(i + 1, prev)

            if prev == "" or abs(ord(prev) - ord(s[i])) <= k:
                output = max(output, 1 + recurssion(i + 1, s[i]))
            return output

        return recurssion(0, "")


    """
    Attempt: Fired
    Accepted: 20%
    
    This question is similar to the 300_longest-increasing-subsequence. There is just a little trick we need to take care to ensure that the absolute distance is taken care of.
    """
    def longestIdealString(self, s: str, k: int) -> int:
        nexts = collections.defaultdict(int)

        for i in range(len(s)):
            current_max = 0
            for prev_ord in range(ord(s[i]) - k, ord(s[i]) + k + 1):
                current_max = max(current_max, nexts[chr(prev_ord)] + 1)
            nexts[s[i]] = current_max

        return max([nexts[i] for i in nexts])


if __name__ == '__main__':
    print(Solution().longestIdealString(s = "acfgbd", k = 2))
    print(Solution().longestIdealString(s = "abcd", k = 3))
    print(Solution().longestIdealString("dyyonfvzsretqxucmavxegvlnnjubqnwrhwikmnnrpzdovjxqdsatwzpdjdsneyqvtvorlwbkb", 7))
    print(Solution().longestIdealString("", 16))
